function _castVote(
    uint256 proposalId,
    address account,
    uint8 support,
    string memory reason
) internal override virtual returns (uint256) {

    uint256 deltaWeight = super._castVote(proposalId, account, support, reason);  //HARNESS
    ghost_sum_vote_power_by_id[proposalId] += deltaWeight;

    return deltaWeight;        
}

